import React from 'react'

const Breadcrumb = () => {
  return (
    <div>
        <ul className="space-x-2">
            <li className="inline-block">Home</li>
            <li className="inline-block">Listing</li>
            <li className="inline-block">Details</li>
        </ul>
    </div>
  )
}

export default Breadcrumb
